import React from 'react';

function Projects() {
  const projects = [
    {
      title: "Application de Gestion",
      description: "Application web de gestion développée en PHP/Laravel pour [Client/Stage]",
      technologies: ["PHP", "Laravel", "MySQL", "Bootstrap"],
      link: "#"
    },
    {
      title: "Site E-commerce",
      description: "Site e-commerce développé en React pour un projet scolaire",
      technologies: ["React", "Node.js", "MongoDB"],
      link: "#"
    }
  ];

  return (
    <section id="projects" className="projects">
      <h2>Mes Projets</h2>
      <div className="projects-grid">
        {projects.map((project, index) => (
          <div key={index} className="project-card">
            <h3>{project.title}</h3>
            <p>{project.description}</p>
            <div className="technologies">
              {project.technologies.map(tech => (
                <span key={tech} className="tech-tag">{tech}</span>
              ))}
            </div>
            <a href={project.link} className="project-link">Voir le projet</a>
          </div>
        ))}
      </div>
    </section>
  );
}

export default Projects;
